_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Desde 2023, temos buscado compreender e mapear o impacto de Modelos de Linguagem na rea de Engenharia de Software. Nesta apresentao, vamos sintetizar os resultados desse nosso esforo, analisando os pontos fortes e fracos desses modelos, sempre com foco no desenvolvimento de software. Tambm comentaremos e colocaremos em perspectiva conceitos como vibe coding e, por fim, discutiremos o impacto que Modelos de Linguagem podem ter no mercado de trabalho.\n\nMini bio:\nMarco Tulio Valente  doutor em Cincia da Computao pela UFMG, onde  Professor Associado desde 2009. Antes, foi professor da PUC Minas e analista de sistemas na Telemig. Atua em Engenharia de Software, rea na qual publicou mais de uma centena de artigos, orientou dezenas de dissertaes e teses, e recebeu mais de 25 prmios.  autor do livro Engenharia de Software Moderna, adotado por mais de 500 professores no Brasil e publicado tambm em ingls em 2024.\n\nhttps://homepages.dcc.ufmg.br/~mtov/\n\nhttps://engsoftmoderna.info/","commandRuns":[{"startIndex":935,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"COgBEM2rARgBIhMI3uPz-q7rkAMVvgceAB3yfhssSNW8jcmdwJeCWcoBBOM7pn8=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbkF4em9QUzIxTHdQWU5YZmk0YnBJRXhobmlVZ3xBQ3Jtc0tsbjdBeVpSLUFFOFhLUDUtUFJHU0tNN21QemdHMGRRb050Tkk0WVJZVmtRbFQ0bkFPcE10dmwtMFJxR0o4QkxvbUo5SU1GTGMtZ29yeDF4UW5lRE9zVXJiTXpnWnNvMWZzTV9hNUxsX1VKMzEtbEhPRQ\u0026q=https%3A%2F%2Fhomepages.dcc.ufmg.br%2F%7Emtov%2F\u0026v=WQReAdkjXlU","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbkF4em9QUzIxTHdQWU5YZmk0YnBJRXhobmlVZ3xBQ3Jtc0tsbjdBeVpSLUFFOFhLUDUtUFJHU0tNN21QemdHMGRRb050Tkk0WVJZVmtRbFQ0bkFPcE10dmwtMFJxR0o4QkxvbUo5SU1GTGMtZ29yeDF4UW5lRE9zVXJiTXpnWnNvMWZzTV9hNUxsX1VKMzEtbEhPRQ\u0026q=https%3A%2
